import Select from "react-select/dist/declarations/src/Select";
const Location=()=> {
 const options=[
  {value:"jaipur",label:"Jaipur"},
  {value:"delhi",label:"Delhi"}, 
  {value:"bombay",label:"Bombay"},
  {value:"goa",label:"Goa"},
];
return<Select options={options}/>

}
      export default Location;
